import React, { useState } from 'react';
import './App.css';

const API_BASE_URL = 'http://127.0.0.1:5000'; // Ensure this matches your Flask backend URL

function App() {
    const [key, setKey] = useState('');
    const [value, setValue] = useState('');
    const [notification, setNotification] = useState('');
    const [searchResult, setSearchResult] = useState('');

    const handleInsert = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch(`${API_BASE_URL}/extendible/insert`, {
                method: 'POST',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({ key: parseInt(key), value }),
            });
            const data = await response.json();
            setNotification(data.message);
            setKey('');
            setValue('');
        } catch (error) {
            setNotification('Error inserting data.');
        }
    };

    const handleDelete = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch(`${API_BASE_URL}/extendible/delete`, {
                method: 'DELETE',
                headers: { 'Content-Type': 'application/json' },
                body: JSON.stringify({ key: parseInt(key) }),
            });
            const data = await response.json();
            setNotification(data.message);
            setKey('');
        } catch (error) {
            setNotification('Error deleting data.');
        }
    };

    const handleSearch = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch(`${API_BASE_URL}/extendible/search?key=${parseInt(key)}`);
            const data = await response.json();
            if (data.message) {
                setSearchResult(data.message);
            } else {
                setSearchResult('Key not found.');
            }
        } catch (error) {
            setSearchResult('Error searching data.');
        }
    };

    return (
        <div className="App">
            <h1>Hashing API UI</h1>
            {notification && <div className="notification">{notification}</div>}
            <form onSubmit={handleInsert}>
                <h2>Insert</h2>
                <input
                    type="number"
                    placeholder="Key"
                    value={key}
                    onChange={(e) => setKey(e.target.value)}
                    required
                />
                <input
                    type="text"
                    placeholder="Value"
                    value={value}
                    onChange={(e) => setValue(e.target.value)}
                    required
                />
                <button type="submit">Insert</button>
            </form>
            <form onSubmit={handleDelete}>
                <h2>Delete</h2>
                <input
                    type="number"
                    placeholder="Key"
                    value={key}
                    onChange={(e) => setKey(e.target.value)}
                    required
                />
                <button type="submit">Delete</button>
            </form>
            <form onSubmit={handleSearch}>
                <h2>Search</h2>
                <input
                    type="number"
                    placeholder="Key"
                    value={key}
                    onChange={(e) => setKey(e.target.value)}
                    required
                />
                <button type="submit">Search</button>
            </form>
            {searchResult && <div className="search-result">{searchResult}</div>}
        </div>
    );
}

export default App;
